query GraphRagAnswer($input: GraphRAGQueryInput!) {
  graphRagAnswer(input: $input) {
    answer
    confidence
    citations {
      entityIds
    }
    why_paths {
      from
      to
      relId
      type
      supportScore
    }
  }
}

