query SimilarEntities($entityId: ID, $text: String, $topK: Int, $investigationId: ID!) {
  similarEntities(entityId: $entityId, text: $text, topK: $topK, investigationId: $investigationId) {
    entity {
      id
      type
      label
      description
      properties
      confidence
    }
    similarity
  }
}

